/*Table structure for table `notification_provider` */

DROP TABLE IF EXISTS `notification_provider`;

CREATE TABLE `notification_provider` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `NOTIFICATION_TYPE_ID` bigint(20) DEFAULT NULL,
  `USERNAME` varchar(25) DEFAULT NULL,
  `PASSWORD` varchar(25) DEFAULT NULL,
  `REQUEST_URL` varchar(25) DEFAULT NULL,
  `CREATED_DATE` datetime DEFAULT NULL,
  `MODIFIED_DATE` datetime DEFAULT NULL,
  `CREATED_BY` bigint(20) DEFAULT NULL,
  `MODIFIED_BY` bigint(20) DEFAULT NULL,
  `IS_ACTIVE` varchar(1) DEFAULT NULL,
  `property` varchar(50) DEFAULT NULL,
  `PROVIDER_NAME` varchar(25) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK1_NOTIFICATION_PROVIDER` (`NOTIFICATION_TYPE_ID`),
  CONSTRAINT `FK1_NOTIFICATION_PROVIDER` FOREIGN KEY (`NOTIFICATION_TYPE_ID`) REFERENCES `notification_type` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

