  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `TEMPLATE_NAME` varchar(1000) DEFAULT NULL,
  `NOTIFICATION_TYPE_ID` bigint(20) NOT NULL,
  `CREATED_DATE` datetime DEFAULT NULL,
